import './App.css';
import { Link } from 'react-router';

function RightMenu(){
    const nav = {news:'Новости', home: 'Главная', tri:'Три', chetire:'Четыре', pyat:'puagbapguhauphga'}
    return (
        <div className="alignRight">
            <ul>
                <li><Link to="/Content">{nav.news}</Link></li>
                <li>{nav.home}</li>
                <li>{nav.tri}</li>
                <li>{nav.chetire}</li>
                <li>{nav.pyat}</li>
            </ul>
        </div>
    );
}

export default RightMenu
